`,paraId:54,tocIndex:7},{value:"3.6",paraId:55,tocIndex:7},{value:" \u5728\u6570\u7EC4\u65B9\u6CD5\u7684\u56DE\u8C03\u51FD\u6570\u4E2D\u4F7F\u7528 return.\u5982\u679C\u51FD\u6570\u4F53\u53EA\u6709\u4E00\u6761\u8FD4\u56DE\u6CA1\u6709\u526F\u4F5C\u7528\u7684\u58F0\u660E\u5219\u53EF\u4EE5\u7701\u7565 return, \u9075\u5FAA ",paraId:56,tocIndex:7},{value:"8.2",paraId:57,tocIndex:7},{value:". eslint: ",paraId:56,tocIndex:7},{value:"array-callback-return",paraId:56,tocIndex:7},{value:`// bad
