`,paraId:260,tocIndex:19},{value:"15.6",paraId:261,tocIndex:19},{value:" \u57FA\u672C\u7684\u6587\u4EF6\u540D\u5E94\u8BE5\u548C\u9ED8\u8BA4 export \u7684\u540D\u5B57\u521A\u597D\u5339\u914D.",paraId:262,tocIndex:19},{value:`// file 1 contents
